import styles from './SeeMore.module.scss';
import { useState } from 'react';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLanguage } from '@fortawesome/free-solid-svg-icons';
import Proper from '../../Proper';
function SeeMore() {
    const [listSeeMore] = useState([
        {text: 'English', icon: faLanguage },
        {text: 'Feedback and help', icon: faLanguage },
        {text: 'Keyboard shortcuts', icon: faLanguage },
    ]);

    const renderListSeeMore = (listSeeMore) => {
        listSeeMore.map( (seeMore, index) => {
            return (
                <>
                    <Proper searchValue={seeMore.text} icon={seeMore.icon} />
                </>
            );
        })
    }

    return ( 
        <div className={styles['wrapper']}>
            {
                renderListSeeMore(listSeeMore)
            }
        </div>
     );
}

export default SeeMore;
